export const junhuaLoubanSetOpacity = (i) => {
    junhuaLoubanOpacity.forEach((item) => {
        if (Object.is(item.name, "均化底层楼板带透明通道_1")) {
            item.material.transparent = i == 1 ? false : true;
            item.material.opacity = i;
        }
    });
};

// 粉料动画模型显示隐藏
export const fenliaoMeshHide = (bool) => {
    fenliaoMesh.visible = bool;
};

// 均化间动画外层部分物体透明度设置。
export const fenliaoOpacity = (bool, opacity) => {
    // console.log(junhuaDongHuaMesh)
    junhuaDongHuaMesh.forEach((item) => {
        item.material.transparent = bool;
        item.material.opacity = opacity;
        bool ? container.addBloom(item) : container.removeBloom(item);
    });
    junhuaNoOpacity.forEach((obj) => {
        if (obj) {
            if (obj.isMesh) {
                obj.material.transparent = false;
                obj.material.opacity = 1;
                container.removeBloom(obj);
            } else {
                obj.traverse((item) => {
                    if (item.isMesh) {
                        item.material.transparent = false;
                        item.material.opacity = 1;
                        container.removeBloom(item);
                    }
                });
            }
        }
    });
    junhuaChangeOpacity.forEach((obj) => {
        if (obj) {
            if (obj.isMesh) {
                obj.material.opacity = opacity == 1 ? opacity : 0.2;
            } else {
                obj.traverse((item) => {
                    if (item.isMesh) {
                        item.material.opacity = opacity == 1 ? opacity : 0.5;
                    }
                });
            }
        }
    });
};

// 分料动画1执行
export const fenliaoAnimationOne = () => {
    setTimeout(() => {
        fenliaoFMmove.forEach((item) => {
            item.visible = true;
            if (item.name == "楼上阀门M01-01动") {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 1, 0), Math.PI / 2);
            } else {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 0, 1), Math.PI / 2);
            }
        });
        fenliaoAnimationMesh.forEach((item) => {
            item.visible = false;
        });
    }, 1000);

    setTimeout(() => {
        fenliaoFMmove.forEach((item) => {
            item.visible = true;
            if (item.name == "楼上阀门M01-01动") {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 1, 0), Math.PI / 2);
            } else {
                item.rotateOnWorldAxis(new THREE.Vector3(0, 0, 1), Math.PI / 2);
            }
        });
        fenliaoAnimationMesh.forEach((item) => {
            item.visible = true;
        });
    }, 4000);
};

// 立磨间漫游开始楼梯隐藏
export const limoStaircaseToggle = (bool) => {
    limoLouTihidden.visible = bool;
};

// 修改粉料动画管道颜色
export const fixFLDHcolors = (color) => {
    liziPngMove.forEach((item) => {
        item.material.color.set(color);
    });
};
